import React, { Component } from "react";
import { observer } from "mobx-react";
import styled from "styled-components";

const Pong = observer(
  class Pong extends Component {
    render() {
      const Container = styled.div`
        color: red;
      `;
      return (
        <div>
          <h1>{this.props.store.data}</h1>
          <h1>{this.props.store.compdata}</h1>
          <div className="game">
            <div className="middash" />
            <div className="bars" />
            <div className="bars" />
            <span className="ball" />
          </div>
        </div>
      );
    }
  }
);

export default Pong;
